function App() {
  return (
    <div className="App">
      <h1>About the author</h1>
      <p>
        <a href="#home">Kahono</a> is a problem solver, an opportunist, smart, talented young man (or he likes to think so).
        His world revolves around software, mostly writing it, solving problems by writing code.
        He has been in this field for quite sometime, 2 years (^-^). <br/>
        In the 2 years , he has picked up some skills including but not limited to: front-end design, back-end engineering, app development, software testing. <br/>
        He has ;earnt some pretty cool languages such as <a href="#go">Go</a>, his favorite one, simple syntax and all, <a href="#go">Rust</a>,
        actually the hardest thing I've mastered, <a href="#go">Javascript</a>, his favorite toy, <a href="#go">PHP</a>, well, he had no comment on this one, among others.
        <br/>
        Since 2 years is like a really long time, <a href="#go">Kahono</a> has put his hands on several
      </p>
    </div>
  );
}

export default App;
